import { useState } from 'react';
import Layout from '../components/Layout';
import styled from 'styled-components';

export const IndexWrapper = styled.div`
  padding: 0px 0px 0px 0px;
`;
 
const Index = () => {
 
    return ( 
        <IndexWrapper>
            <Layout>

                <h1> Dani</h1>

            </Layout>
        </IndexWrapper>
     );
}
 
export default Index;
